    public static List<Integer> parse_nested_parens(String paren_string) {
        String[] paren_groups = paren_string.split(" ");
        List<Integer> result = new ArrayList<Integer>();

        for (String paren_group : paren_groups) {
            int depth = 0;
            int max_depth = 0;
