        int result = 0;
        char[] str_chars = str.toCharArray();

        for (char c : str_chars) {
            if (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u' || c == 'A' || c == 'E' || c == 'I' || c == 'O'
