package humaneval.buggy;



public class SEARCH {
    public static int search(int[] lst) {
        int max = -1;
        for (Integer i : lst) {
            if (i > max)
                max = i;
        }

        int result = -1;
        int[] frq = new int[max];
        for (int i = 0; i < lst.length; i += 1)  frq[i] += 1;
        for (int i = 0; i < frq.length; i += 1) if (frq[i] >= i) result = i;

        return result;
    }
}

